import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';


class App extends Component {
  getPokemon() {
    const poke=fetch('https://pokeapi.co/api/v2/pokemon/bulbasaur/');

    return poke
  }


  render() {
    return (
      <div>
        <h1>Hello, {this.getPokemon()}</h1>
      </div>

    )
  }
}


export default App;
